Make Catalog Items Available On External Sites with Lightning Out

Site admins can use a Lightning Out component to make catalog items available on external sites, which enable customers to order services from external sites without needing access to Service Catalog. Additionally, authenticated users can use external sites to confer their authentication to unauthenticated users, giving those unauthenticated users access to catalog items.

Where: This change applies to Lightning Experience in Enterprise, Performance, and Unlimited editions.

Who: To use this feature, you must have the Service Catalog Access permission set license and one of these community licenses: Channel Community, Customer Community, Customer Community Login, Customer Community Plus, Customer Community Plus Login, External Apps, Partner Community, or Partner Community Login.

How: Add this component as a dependency to the Lightning Out app. 

<html>
  <script src="SiteURL/lightning/lightning.out.js"></script>
  <body>
    <h1>Header</h1>
    <div id="item"></div>
  </body>
  <script>
    // What needs to be done: in your org, add this URL (probably localhost) to CORS
    var token = "<token, not prefixed by Bearer>"
    $Lightning.use("runtime_service_servicecatalog:serviceCatalogLightningOut", function() {
             $Lightning.createComponent("runtime_service_servicecatalog:catalogItem",
            { itemApiName: "<itemName>", targetCustomerId: “<CustomerId>” },
            "item",
            function(newCmp, status, errorMessage) {
                if (status === "SUCCESS") {
                    console.log("Component Created Successfully");
                } else {
                    console.log("Component not created | " + errorMessage);
                }
            }
        );
    },"SiteURL"
    ,token);
  </script>
</html>

SEE ALSO: Salesforce Lightning Web Components Developer Guide: Use Components Outside Salesforce with Lightning Out (Beta) and Salesforce Lightning Web Components Developer Guide: Share Lightning Out Apps with Unauthenticated Users.
